        return a

    def extended_gcd(a, b):
        if a == 0:
            return (b, 0, 1)
        else:
            g, y, x = extended_gcd(b % a, a)
            return (g, x - (b // a) * y, y)

    def find_any_solution(a, b, c):
        g = gcd(abs(a), abs(b))

        if c % g:
            return (0, 0)

        a //= g
        b //= g
        c //= g

        g, x, y = extended_gcd(a, b)

