def solve():

    def get_ring(n):
        k = ceil((-1 + sqrt(1 + 8*n)) / 6)  # ring number formula
        return k

    def move_in_ring(n, k):
        n -= 3*k*(k-1)
        x, y = k, 0
        for _ in range(6):
            if n <= k-1:
                x, y = x-1, y+1
            elif n <= 2*(k-1):
                x, y = x-1, y
            elif n <= 3*(k-1):
                x, y = x, y-1
            elif n <= 4*(k-1):
                x, y = x+1, y-1
            elif n <= 5*(k-1):
                x, y = x+1, y
            else:
                x, y = x, y+1
            n -= 1

        return x, y

    n = int(input().strip())
    k = get_ring(n)
    x, y = move_in_ring(n, k)

    return x, y

