def solve():
    from bisect import bisect_left, bisect_right
    n = int(input())
    a = list(map(int, input().split()))
    zeros = [i for i in range(n) if a[i] == 0]

    def find_closest_zero_index(i):
        idx = bisect_left(zeros, i)
        if a[i] == 0:
            return 0
        if idx == 0:
            return zeros[idx] - i
        if idx == len(zeros):
            return i - zeros[-1]
        return min(zeros[idx] - i, i - zeros[idx - 1])

    distances = [find_closest_zero_index(i) for i in range(n)]
    print(' '.join(map(str, distances)))

solve()

