def solve():
    n, x = map(int, input().split())
    a = list(map(int, input().split()))

    max_sum, cur_sum, max_multiplied = 0, 0, 0

    for num in a:
        cur_sum = max(0, cur_sum + num)
        max_sum = max(max_sum, cur_sum)

        cur_multiplied = max(0, cur_multiplied + num * x)
        max_multiplied = max(max_multiplied, cur_multiplied)

