from typing import List

def solve(n: int, m: int, k: int) -> int:
    def count_less_or_equal(x: int, row: int, col: int) -> int:
        res = 0
        for i in range(1, row+1):
            res += min(x // i, col)
        return res

    left, right = 1, n*m
    while left < right:
        mid = left + (right - left) // 2
        if count_less_or_equal(mid, n, m) < k:
            left = mid + 1
        else:
            right = mid
    return left

solve()

