def solve():
    n, m, k, x, y = map(int, input().split())

    if n == 1:
        min_questions = (k // m) + int(k % m >= y)
        max_questions = min_questions
        times_asked_sergei = (k // m) + int(k % m >= y)
    else:
        total_pupils = n * m
        cycle_length = 2 * (n - 1) * m
        full_cycles = k // cycle_length
        remaining_questions = k % cycle_length

        if remaining_questions == 0:
            remaining_questions = cycle_length

        if remaining_questions <= m * (x - 1) + y:
            min_questions = full_cycles * 2
        else:
            min_questions = full_cycles * 2 + 1

        max_questions = full_cycles * 2 + 1

        if x == 1:
            times_asked_sergei = full_cycles * 2 + 2 * (y <= remaining_questions)
        else:
            times_asked_sergei = full_cycles * 2 + 1 + 2 * (y <= remaining_questions and x == n)

    print(max_questions, min_questions, times_asked_sergei)

solve()

