def solve():
    from math import factorial

    r, s, p = map(int, input().split())

    def comb(n, k):
        return factorial(n) / factorial(k) / factorial(n - k)

    def prob(x, y, z):
        return comb(x + y + z - 1, x) * comb(y + z - 1, y) / comb(x + y + z, 2)

    total = prob(r, s, p)
    prob_r = prob(r, s, p) - prob(r, s-1, p) - prob(r, s, p-1) + prob(r, s-1, p-1)
    prob_s = prob(s, p, r) - prob(s-1, p, r) - prob(s, p, r-1) + prob(s-1, p, r-1)
    prob_p = prob(p, r, s) - prob(p-1, r, s) - prob(p, r-1, s) + prob(p-1, r, s-1)

    print("{:.12f} {:.12f} {:.12f}".format(prob_r/total, prob_s/total, prob_p/total))

solve()

