def solve(n):
    MOD = 998244353

    def factorial(n):
        result = 1
        for i in range(1, n + 1):
            result = (result * i) % MOD
        return result

    def binomial(n, k):
        numerator = 1
        for i in range(n, n - k, -1):
            numerator = (numerator * i) % MOD
        denominator = factorial(k)
        return (numerator * pow(denominator, MOD - 2, MOD)) % MOD

    def count_trees(n):
        if n == 1:
            return 1
        if n % 2 == 1:
            return 0
        result = binomial(n - 1, n // 2 - 1)
        result = (result * count_trees(n // 2)) % MOD
        result = (result * count_trees(n // 2)) % MOD
        return result

    return count_trees(n)

# Example usage
