def solve(n: int) -> int:
    MOD = 998244353

    def binexp(base, exp):
        result = 1
        while exp > 0:
            if exp % 2 == 1:
                result = (result * base) % MOD
            base = (base * base) % MOD
            exp //= 2
        return result

    def nCr(n, r):
        numerator = 1
        for i in range(n, n-r, -1):
            numerator = (numerator * i) % MOD
        denominator = 1
        for i in range(1, r+1):
            denominator = (denominator * i) % MOD
        return (numerator * binexp(denominator, MOD-2)) % MOD

    result = 0
    for k in range(n//2 + 1):
        ways = nCr(n, 2*k) * nCr(2*k, k) * binexp(k+1, MOD-2) % MOD
        result = (result + ways) % MOD

    return result


solve()

