    m, a, b = map(int, input().split())

    if a > b:
        a, b = b, a

    if a == 1:
        return (m*(m+1)//2)

    visited = [False] * (b+1)
    visited[0] = True

    queue = [0]

    for i in range(b):
        if visited[i]:
            if i+a <= m and not visited[i+a]:
                visited[i+a] = True
                queue.append(i+a)
            if i+b <= m and not visited[i+b]:
                visited[i+b] = True
                queue.append(i+b)

    while queue:
        current = queue.pop(0)

        if current + a <= m and not visited[current+a]:
            visited[current+a] = True
            queue.append(current+a)
        if current - b >= 0 and not visited[current-b]:
            visited[current-b] = True
            queue.append(current-b)

    return sum(visited)

solve()

