def solve():
    import math

    m = int(input())

    def count_trailing_zeroes(num):
        count = 0
        while num % 10 == 0:
            count += 1
            num //= 10
        return count

    def factorial_trailing_zeroes(n):
        count = 0
        i = 5
        while n // i >= 1:
            count += n // i
            i *= 5
        return count

    def find_n_with_trailing_zeroes(m):
        n_values = []
        for i in range(1, m*5):
            if factorial_trailing_zeroes(i) == m:
                n_values.append(i)
        return n_values

    n_values = find_n_with_trailing_zeroes(m)
    print(len(n_values))
    for n in n_values:
        print(n, end=' ')

