        if b == 0:
            return 1
        if b % 2 == 1:
            return (a * power(a, b-1)) % mod
        half = power(a, b//2)
        return (half * half) % mod

    def nCr(n, r):
        if r > n:
            return 0
        num = math.factorial(n) % mod
        den = (math.factorial(r) * math.factorial(n-r)) % mod
        return (num * power(den, mod-2)) % mod

    ans = power(2, m-1) * nCr(n-1, m-1) % mod
    print(ans)

