def solve():
    N, M = map(int, input().split())
    passages = np.zeros(N)
    for _ in range(M):
        s, t = map(int, input().split())
        passages[s-1] += 1
    probabilities = np.zeros(N)
    probabilities[0] = 1
    blocked = False
    for i in range(N-1):
        if not blocked and passages[i] == 1:
            probabilities[i+1] += probabilities[i]
        elif not blocked and passages[i] > 1:
            probabilities[i+1] += probabilities[i] / passages[i]
            blocked = True
        else:
            probabilities[i+1] += probabilities[i]
    return "{:.10f}".format(probabilities[N-1])

