def solve():
    n = int(input().strip())

    n_str = str(n)
    digits_count = len(n_str)

    def generate_permutations(n_str, permutations, curr_permutation, used):
        if len(curr_permutation) == digits_count:
            permutations.add(int(curr_permutation))
            return

        for i in range(digits_count):
            if not used[i]:
                used[i] = True
                generate_permutations(n_str, permutations, curr_permutation + n_str[i], used)
                generate_permutations(n_str, permutations, n_str[i] + curr_permutation, used)
                used[i] = False

    permutations = set()
    generate_permutations(n_str, permutations, "", [False] * digits_count)

    return len([p for p in permutations if p >= n])

solve()

