def solve():
    n, x, y, c = map(int, input().split())

    def count_seconds(x, y):
        if n == 1:
            return 0

        def get_neighbor_count(row, col):
            count = 0
            if row-1 > 0 and (row-1 == x and col == y):
                count += 1
            if col-1 > 0 and (row == x and col-1 == y):
                count += 1
            if row+1 <= n and (row+1 == x and col == y):
                count += 1
            if col+1 <= n and (row == x and col+1 == y):
                count += 1
            return count

        seconds = 0
        while True:
            total_on = 1
            for i in range(1, n+1):
                for j in range(1, n+1):
                    if get_neighbor_count(i, j) > 0:
                        total_on += 1
            if total_on >= c:
                return seconds
            for i in range(1, n+1):
                for j in range(1, n+1):
                    if get_neighbor_count(i, j) > 0:
                        x, y = i, j
            seconds += 1

    return count_seconds(x, y)

solve()

