import heapq

def solve():
    n, m, p = map(int, input().split())
    graph = defaultdict(list)
    for _ in range(m):
        a, b, c = map(int, input().split())
        graph[a].append((b, c))

    visited = set()
    pq = [(0, 1, 0)]

    max_coins = {}
    while pq:
        coins, node, time = heapq.heappop(pq)

        if node == n:
            max_coins[time] = max(max_coins.get(time, 0), coins)

        if time >= n:
            break

        if (node, time) in visited:
            continue
        visited.add((node, time))

        for neighbor, edge_coins in graph[node]:
            new_coins = coins + edge_coins
            heapq.heappush(pq, (new_coins, neighbor, time + 1))

    result = max(max_coins.get(t) - t * p for t in range(1, n + 1))
    print(result if result >= 0 else -1)


solve()

