import math

def solve():
    n = int(input())
    factors = []
    while n % 2 == 0:
        factors.append(2)
        n //= 2
    for i in range(3, int(math.sqrt(n)) + 1, 2):
        while n % i == 0:
            factors.append(i)
            n //= i
    if n > 2:
        factors.append(n)

    min_num = 1
    for factor in sorted(set(factors)):
        count = factors.count(factor)
        if count % 2 == 1:
            min_num *= factor
            count -= 1
        count //= 2
        min_num *= factor**count

    operations = len(set(factors))
    if min_num == 1:
        operations = 0

    print(min_num, operations)

solve()

