import math

def solve():
    n = int(input())

    def factorize(num):
        factors = []
        for i in range(2, int(math.sqrt(num)) + 1):
            count = 0
            while num % i == 0:
                count += 1
                num //= i
            if count > 0:
                factors.append((i, count))
        if num > 1:
            factors.append((num, 1))
        return factors

    def num_operations(factors):
        total_ops = 0
        for factor in factors:
            total_ops += factor[1]
        return total_ops

    min_n = n
    min_ops = num_operations(factorize(n))
    for i in range(2, int(math.sqrt(n)) + 1):
        ops = num_operations(factorize(n // i)) + i
        if ops < min_ops:
            min_ops = ops
            min_n = n // i

    print(min_n, min_ops)

solve()

