import math

def solve():
    n = int(input())

    def prime_factors(num):
        factors = []
        while num % 2 == 0:
            factors.append(2)
            num = num // 2
        for i in range(3, int(math.sqrt(num)) + 1, 2):
            while num % i == 0:
                factors.append(i)
                num = num // i
        if num > 2:
            factors.append(num)
        return factors

    factors = prime_factors(n)
    res = 1
    for factor in set(factors):
        count = factors.count(factor)
        res *= pow(factor, count//2)

    return res, len(set(factors))

solve()

