from collections import Counter

def solve():
    n, m = map(int, input().split())
    edges = [tuple(map(int, input().split())) for _ in range(m)]

    vertices = set()
    for edge in edges:
        vertices.update(edge)

    domino_counts = Counter()
    for i in range(1, 7):
        for j in range(i, 7):
            domino = (i, j)
            domino_counts[domino] = 1

    for v in vertices:
        connected = set()
        for edge in edges:
            if v in edge:
                connected.add(edge[0] if edge[0] != v else edge[1])

        half_counts = Counter()
        for c in connected:
            for edge in edges:
                if c in edge and v in edge:
                    a, b = edge
                    half = (abs(a - v), abs(b - v))
                    half_counts[half] += 1

        for half, count in half_counts.items():
            if count > 1:
                domino_counts[half] -= (count - 1)

    max_dominoes = sum(domino_counts.values())
    print(max_dominoes)

solve()

