def solve():
    import heapq

    n = int(input())
    limits = list(map(int, input().split()))

    heap = []
    total = 0

    for limit in limits:
        heapq.heappush(heap, (-1 * limit, limit))

    while heap:
        count, limit = heapq.heappop(heap)
        count = -1 * count
        if count <= total:
            total += count
        else:
            count = total
            total += count - 1
        if count > 0:
            heapq.heappush(heap, (-(count - 1), limit))

    print(total)

solve()

