def solve(s: str) -> str:
    from collections import Counter

    cnt = Counter(s)
    odd_count = sum([1 for c in cnt.values() if c % 2 != 0])

    if odd_count > 1:
        return "impossible"

    s = list(s)
    n = len(s)

    mid = ''
    palin = [''] * n

    for c in cnt:
        palin[n // 2] = c * (cnt[c] // 2)

    i = 0
    j = n - 1

    for c in cnt:
        occur = cnt[c] // 2

        while occur > 0:
            palin[i] = c
            palin[j] = c
            i += 1
            j -= 1
            occur -= 1

            if occur == 1:
                mid = c

    if n % 2 == 0:
        return ''.join(palin)
    else:
        return ''.join(palin) + mid

solve()

