def solve(s: str) -> str:
    import collections

    counter = collections.Counter(s)
    odd_chars = [char for char, count in counter.items() if count % 2 != 0]

    mid_char = ''
    if len(odd_chars) > 1:
        return "NO SOLUTION"
    elif len(odd_chars) == 1:
        mid_char = odd_chars[0]

    left_chars = []
    for char, count in counter.items():
        if count % 2 == 0:
