def solve():
    N, M = map(int, input().split())
    S = list(map(int, input().strip()))

    queue = [(0, [1])]
    visited = set()

    while queue:
        cost, path = heappop(queue)
        pos = path[-1]

        if pos == N:
            return ' '.join([str(num) for num in path[1:]])

        if pos in visited:
            continue
        visited.add(pos)

        for i in range(1, M + 1):
            nxt = pos + i

            if nxt <= N and S[nxt] == 0:
                heappush(queue, (cost + 1, path + [i]))

    return -1

