def solve():
    n = int(input())
    strengths = list(map(int, input().split()))
    graph = {i: [] for i in range(1, n+1)}

    for _ in range(n-1):
        u, v = map(int, input().split())
        graph[u].append(v)
        graph[v].append(u)

    queue = deque()
    visited = set()
    computer_strength = max(strengths)

    for i in range(1, n+1):
        if len(graph[i]) == 1:
            queue.append(i)

    while queue:
