from collections import deque

def solve():
    n = int(input())
    strengths = list(map(int, input().split()))
    graph = {i: [] for i in range(1, n+1)}

    for _ in range(n-1):
        u, v = map(int, input().split())
        graph[u].append(v)
        graph[v].append(u)

    computer_strength = max(strengths)

    visited = [False] * (n+1)
    queue = deque()

    for i in range(1, n+1):
        if len(graph[i]) == 1:
            queue.append(i)

    while queue:
        node = queue.popleft()

        if visited[node]:
            continue

        visited[node] = True

        for neighbor in graph[node]:
            if not visited[neighbor]:
                strengths[neighbor-1] = max(strengths[neighbor-1], strengths[node-1])
                if strengths[neighbor-1] <= computer_strength:
                    queue.append(neighbor)

    return computer_strength


solve()

