from collections import deque

def solve():
    n, m = map(int, input().split())
    piece = [input() for _ in range(n)]

    def find_connected_components():
        visited = [[False for _ in range(m)] for _ in range(n)]
        components = []

        def bfs(x, y):
            component = []
            q = deque([(x, y)])
            while q:
                cx, cy = q.popleft()
                if not (0 <= cx < n) or not (0 <= cy < m) or visited[cx][cy] or piece[cx][cy] == '.':
                    continue
                visited[cx][cy] = True
                component.append((cx, cy))
                q.extend([(cx+1, cy), (cx-1, cy), (cx, cy+1), (cx, cy-1)])

            return component

        for i in range(n):
            for j in range(m):
                if piece[i][j] == 'X' and not visited[i][j]:
                    components.append(bfs(i, j))

        return components

    components = find_connected_components()

    if len(components) == 1:
        component = components[0]
        min_x = min(x for x, _ in component)
        max_x = max(x for x, _ in component)
        min_y = min(y for _, y in component)
        max_y = max(y for _, y in component)

        for x in range(min_x, max_x+1):
            for y in range(min_y, max_y+1):
                if piece[x][y] == '.':
                    print("NO")
                    return

        print("YES")
    else:
        print("NO")

solve()

