from typing import List

def solve() -> None:
    n = int(input())
    a = list(map(int, input().split()))

    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    diffs = [a[i] - a[i-1] for i in range(1, n)]

    divisors = set()
    for i in range(1, n):
        if n % i == 0:
            divisors.add(i)

    for i in range(1, n):
        g = gcd(diffs[0], diffs[i])
        for j in range(1, n):
            g = gcd(g, diffs[j])
        for d in divisors.copy():
            if i % d != 0 or (n - 1) % d != 0:
                divisors.remove(d)

    lengths = list(divisors)
    lengths.sort()

    print(len(lengths))
    print(*lengths)


solve()

