def solve():
    n = int(input())
    initial_weights = list(map(int, input().split()))
    k = int(input())
    final_weights = list(map(int, input().split()))

    queue = deque(enumerate(initial_weights, 1))

    actions = []

    for final_weight in final_weights:
        found = False
        while queue[0][1] != final_weight:
            if queue[0][1] < queue[1][1]:
                queue.append(queue.popleft())
                actions.append((queue[0][0], 'R'))
            else:
                actions.append((queue[0][0], 'L'))
                queue.popleft()
            if not found and len(queue) == k:
                found = True

        if not found:
            print("NO")
            return

    print("YES")
    for action in actions:
        print(action[0], action[1])


solve()

