def solve():
    N, X, D = map(int, input().split())
    MOD = 10**9 + 7

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def comb(n, r):
        num = denom = 1
        for i in range(r):
            num = (num * (n - i)) % MOD
            denom = (denom * (i + 1)) % MOD
        return (num * pow(denom, MOD - 2, MOD)) % MOD

    if D == 0:
        if X == 0:
            return 1
        return N+1

    if D < 0:
        X *= -1
        D *= -1

    mp = {}
    for i in range(N+1):
        if i*D < X:
            continue
        j = (i*D - X) // N
        mp[j] = mp.get(j, 0) + comb(N, i)

    ans = 0
    for k, v in mp.items():
        if v > 0:
            g = gcd(N, v)
            ans += pow(2, k, MOD) * pow(2, (v // g), MOD)
