def solve():
    N, X, D = map(int, input().split())
    # for the case when D = 0
    if D == 0:
        if X == 0:
            return 1
        return N + 1
    else:
        mod_record = {}
        def mod(x, m):
            return x % m
        def aux1(x):
            return (-x) // D
        def aux2(x, y):
            return (aux1(x) - aux1(y)), (mod( aux1(x) * (aux1(x) + 1) // 2 , N) - mod( aux1(y) * (aux1(y) + 1) // 2, N) ) 
        for _ in range(2):
            v1 = mod(X, D)
            for x in range(v1, N+1, D):
                p, q = aux2(x, X)
                mod_record[p, q] = mod_record.get((p, q), 0) + 1
            X += N * D
            D *= -1
        answer = 0
        for k, v in mod_record.items():
            p, q = k
            v = min(v, N)
            answer += v * (v - 1) // 2
            if p == 0:
                answer += v
            else:
                answer += 2 * v * mod_record.get((-p, -q), 0)
        total = (N + 1) * N // 2
        return total - answer

solve()

