def solve():
    N, X, D = map(int, input().split())

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    if D == 0:
        if X == 0:
            return 1
        else:
            return N + 1

    X %= D
    Xabs = abs(X)
    Xdiv = abs(X) // D
    Ydiff = abs(X) % D

    Ccnt = min(Xdiv, N)
    Slst = [(0, 0)]

    for i in range(Ccnt + 1):
        a = i
        b = Ccnt - i
        c = N - Ccnt
        Ofs = a * (a - 1) // 2 + b * (b - 1) // 2 + c * (c - 1) // 2
        Slst.append((a * (2 * Xabs + (a - 1) * D) // 2 - a * (a - 1) * D // 2, Ofs))

    Smx = min(N * (N - 1) // 2, 10**5)
    Mdic = {Slst[i][0] + j * D: Slst[i][1] + j for i in range(Ccnt + 1) for j in range(Smx)}
    Ans = 0

    for i in range(Smx):
        for j in range(Ccnt + 1):
            Lval = i * D - Xabs + Slst[j][0] + j * D
            if Lval >= Xabs:
                break
            if Lval not in Mdic:
                continue
            Ans += Mdic[Lval]

    return Ans

