def solve():
    n, m = map(int, input().split())
    building = [input() for _ in range(n)]
    dp = [[0] * (1 << m) for _ in range(n + 1)]

    for i in range(n - 1, -1, -1):
        for state in range(1 << m):
            dp[i][state] = float("inf")
            for j in range(2):
                ns = state
                if building[i][j] == '1' and (state & 1 << j) == 0:
                    ns |= 1 << j
                dp[i][state] = min(dp[i][state], dp[i + 1][ns] + (m - bin(state).count('1')))

            for k in range(2, m):
                if building[i][k] == '1' and (state & 1 << k) == 0:
                    if building[i][k - 1] == '0':
                        dp[i][state] = min(dp[i][state], dp[i][state | 1 << k] + 1)
                    if building[i][k - 2] == '0':
                        dp[i][state] = min(dp[i][state], dp[i][state | 1 << k] + 1)

    print(dp[0][0])

