def solve():
    import heapq

    n, m = map(int, input().split())
    building = [input() for _ in range(n)]
    lights = sum(int(building[i][j]) for i in range(n) for j in range(1, m+1))

    pq = [(0, 0, 1)]  # (time, floor, room index)
    visited = {(0, 1)}
    total_time = 0

    while lights > 0:
        time, floor, room = heapq.heappop(pq)
        lights -= int(building[floor][room])  # turn off light
        total_time = max(total_time, time)

        for next_floor in [floor+1, floor-1]:
            if next_floor >= 0 and next_floor < n:
                if (next_floor, room) not in visited:
                    heapq.heappush(pq, (time + abs(next_floor - floor) + 1, next_floor, room))
                    visited.add((next_floor, room))

        for next_room in [room+1, room-1]:
            if next_room >= 1 and next_room < m+1:
                if (floor, next_room) not in visited:
                    heapq.heappush(pq, (time + 1, floor, next_room))
                    visited.add((floor, next_room))

    print(total_time)

solve()

