MOD = 10**9 + 7

def solve(n, k):
    dp = [[0 for _ in range(n*n+1)] for _ in range(n+1)]
    # Base case
    dp[0][0] = 1
    for i in range(1, n+1):
        for j in range(n*n+1):
            dp[i][j] = (dp[i][j] + dp[i-1][j] * (i-1)) % MOD
            if j >= i:
                dp[i][j] = (dp[i][j] + dp[i-1][j-i]) % MOD

    ans = 0
    for i in range(n):
        for j in range(n*n+1):
            if abs(j - k) % 2 == 0:
                ans = (ans + dp[i][j] * factorial(n, exact=True) * factorial(n-i, exact=True)) % MOD

    return ans

