def solve(n, m, k):
    MOD = 998244353
    if k > n:
        return 0
    if k == 0 or k == n - 1:
        return pow(m, n, MOD)

    dp = [[0] * (k+2) for _ in range(n+1)]
    dp[1][1] = m
    dp[1][0] = m * (m-1) % MOD

    for i in range(2, n+1):
        for j in range(1, k+2):
            dp[i][j] = (dp[i-1][j-1] + dp[i-1][j] * (m-1)) % MOD

    return (dp[n][k+1] + m * dp[n][k]) % MOD

solve()

