from typing import List

def solve(n: int, m: int, leaders: List[int]) -> List[int]:
    perm = [0] * n
    for i in range(1, n+1):
        visited = [False] * n
        perm[0] = i
        visited[i-1] = True
        valid_perm = True
        for j in range(m-1):
            next_leader = leaders[j] - 1
            next_child = (i + leaders[j]) % n
            if next_child == 0:
                next_child = n
            if perm[next_leader] == 0 and not visited[next_child-1]:
                perm[next_leader] = next_child
                visited[next_child-1] = True
            elif perm[next_leader] != next_child:
                valid_perm = False
                break
        if valid_perm:
            for k in range(n):
                if perm[k] == 0:
                    for j in range(1, n+1):
                        if not visited[j-1]:
                            perm[k] = j
                            break
            return perm
    return [-1]

solve()

